function Headlines({ date, image, title, url }) {
  return (
    <a href="#">
      <div className="headline-left">
      <img className="headline-left-img" src={image.file.url} alt={image.title} />
      </div>
      <div className="headline-right">
        <p>{title}</p>
      </div>
    </a>
  )
}

export default Headlines
